INSERT INTO investment_firms (id, name, description, website, stages, sectors, linkedin_url, created_at, folk_id, folk_workspace_id, folk_list_ids, folk_updated_at, source, updated_at, hq_location, industry, emails, phones, addresses, urls, folk_custom_fields, enrichment_status) VALUES ('d864e58c-8126-468d-b0ad-eb1364b93c62', 'Five Seasons Ventures', 'Five Seasons Ventures is the premier pan-European Venture Capital fund focused on consumer brands, specializing in food-tech investments across the value chain to foster a healthier, more efficient, and sustainable system. We seek future category leaders exhibiting high growth potential, proven technology, and early commercial traction, typically at Series A or B stages. However, we also consider pre-revenue companies with exceptional promise at the Seed stage. Our initial investment ranges from €2-10 million, securing a significant minority stake and a board seat. We prefer syndicated investments with value-add investors and can deploy up to €20 million per company. With a team boasting over 40 years of cumulative VC experience, including 15+ years in food and ag investing, and over 30 years of operational expertise in the industry, we bring deep insights and networks to our portfolio. Supported by strategic and financial investors, we provide access to critical business and financing opportunities. As long-term investors, we leverage our industry knowledge to create enduring value and aim for successful exits for our portfolio companies.', 'https://www.fiveseasons.vc', '[]'::jsonb, '[]'::jsonb, 'https://www.linkedin.com/company/five-seasons-ventures', '2025-12-25T18:12:57.904Z', 'com_aea5101d-1211-4c06-84bd-b98d02f76e78', 'grp_0f372e1a-144c-4cab-b424-911ee25e86a2', '["grp_ae60bf78-cc82-478f-8b81-ecef406dc0dd","grp_8eea3d2e-8419-4191-8324-13f0b6e7bd25","grp_0f372e1a-144c-4cab-b424-911ee25e86a2","grp_8ae8dd89-d8de-419e-9697-01e42bf5a7a1","grp_62ed75ea-252a-4b2f-8f23-a9da0c20983d"]'::jsonb, '2025-12-25T21:32:42.141Z', '