INSERT INTO investment_firms (id, name, description, website, stages, sectors, linkedin_url, created_at, folk_id, folk_workspace_id, folk_list_ids, folk_updated_at, source, updated_at, hq_location, industry, emails, phones, addresses, urls, folk_custom_fields, enrichment_status) VALUES ('0ca5a2bc-3538-49e0-9343-10e9f057d67b', 'Patero', 'There are five of us and Patero is our common nest. We come from Logio and we want to improve the world around us. We are all different and we have a simple rule in our genes that when everything comes together in the right proportion, at the right time, in the right place and agrees on something in common, a unique combination is created that changes established principles. We founded our business on the principle of making complex things simpler and more efficient. We rid the world of unnecessary waste. Our mission is to make things nicer, make money and have fun doing it. We associate our business with clear ethical values. Sometimes we invest in a technological miracle and other times we invest in an approach that goes back to traditions and the natural way things work. We are not afraid to connect traditional fields with modern technologies and we believe that it is the merging of different contexts that leads to bigger and better wholes. If we set them up correctly step by step, then we can benefit from them for the whole society.', 'https://www.patero.cz/', '[]'::jsonb, '[]'::jsonb, 'https://www.linkedin.com/company/patero-s-r-o', '2025-12-25T17:36:44.029Z', 'com_ca6daf2c-948d-48f8-a5f3-2cc6b93390c1', 'grp_62ed75ea-252a-4b2f-8f23-a9da0c20983d', '["grp_62ed75ea-252a-4b2f-8f23-a9da0c20983d"]'::jsonb, '2025-12-25T17:36:44.028Z', 'folk', '2025-12-25T17:36:44.029Z', 'Czech Republic', 'Machine Learning, Supply Chain, SaaS, Logistics', '[]'::jsonb, '[]'::jsonb, '[]'::jsonb, '[]'::jsonb, '{"Title":null,"Status":null,"Fund HQ":null,"Website":"https://www.patero.cz/","Linkedin":"https://www.linkedin.com/company/patero-s-r-o","Last Name"